import Card from "./card.js";

export default function PlayerList(props) {
    return <>
    <ul>
        {props.players.map(players => <li key={players.id}>
            <Card playerDetails={players} />
        </li>)}
        <button onClick = {() => props.onDeleteChange(props.id)}>Delete</button>

    </ul>
    </>
}
